import React, { useEffect, useState } from 'react';
import {  Card, Col, Row } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import './newRouteCss.css';




const Route = ({title, waterLevel, duration, cost, learn, pic, setRoute, waterLevelSetting}) => {

    const [waterLevelAPI, setWaterLevel] = useState(null);
    const [newPic, setPic] = useState(null);

    //getting waterlevel data
    const url = `https://waterservices.usgs.gov/nwis/iv/?format=json&sites=0${waterLevel}&parameterCd=00065&siteStatus=all`

    useEffect(() => {
        async function getData() {
            const response = await fetch(url);
            const data = await response.json();
            const waterLevelStat = data.value.timeSeries[0].values[0].value[0].value
            setWaterLevel(waterLevelStat)
        }
        setPic(pic)
        getData();
    },[])


    //rendering waterlevel data and style
    let renderWaterLevel = null
    let boxClass = null
    let clickFunction = null
    if(waterLevelAPI === null) {
        renderWaterLevel = (null)
        boxClass = 'text'
        console.log(pic)
        clickFunction = (
            () => {setRoute(title)}
        )
    }   else {
        if(waterLevelSetting > waterLevelAPI) {
            boxClass = 'too-low'
            clickFunction = (null)
        }else {
            boxClass = 'text'
            clickFunction = (
                () => {setRoute(title)}
            )
        }
        renderWaterLevel = waterLevelAPI
    }


    




  return (
    <div>
                 <img 
                src={pic}
                alt="new"
                />
            <li className="booking-card" styles={{ backgroundImage: `url(https://images.pexels.com/photos/51311/cow-calf-cattle-stock-51311.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940)` }} >
                <div className="book-container">
                <div className="content">
                    <button className="btn">Book</button>
                </div>
                </div>
                <div className="informations-container">
                <h2 className="title"><FontAwesomeIcon icon="map-marker-alt"  size="1x" /> {title}</h2>
                <p className="sub-title">From Crystal Lake to St. Joseph</p>
                <p className="price"><svg className="icon" style={{width: '24px', height: '24px'}} viewBox="0 0 24 24">
                <path fill="currentColor" d="M3,6H21V18H3V6M12,9A3,3 0 0,1 15,12A3,3 0 0,1 12,15A3,3 0 0,1 9,12A3,3 0 0,1 12,9M7,8A2,2 0 0,1 5,10V14A2,2 0 0,1 7,16H17A2,2 0 0,1 19,14V10A2,2 0 0,1 17,8H7Z" />
                </svg>$ {cost}</p>
                <p className="info-p"><FontAwesomeIcon icon="clock"  size="1x" /> {duration} hrs</p>
                <p className="info-p"><FontAwesomeIcon icon="water"  size="1x" /> {waterLevelAPI} ft</p>
                <div className="more-information">
                    <div className="info-and-date-container">
                    <div className="box info">
                        <svg className="icon" style={{width: '24px', height: '24px'}} viewBox="0 0 24 24">
                <path fill="currentColor" d="M11,9H13V7H11M12,20C7.59,20 4,16.41 4,12C4,7.59 7.59,4 12,4C16.41,4 20,7.59 20,12C20,16.41 16.41,20 12,20M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2M11,17H13V11H11V17Z" />
                </svg>
            
                        <p>Learn More</p>
                    </div>
                    <div className="box date">
                        <svg className="icon" style={{width: '24px', height: '24px'}} viewBox="0 0 24 24">
                <path fill="currentColor" d="M19,19H5V8H19M16,1V3H8V1H6V3H5C3.89,3 3,3.89 3,5V19A2,2 0 0,0 5,21H19A2,2 0 0,0 21,19V5C21,3.89 20.1,3 19,3H18V1M17,12H12V17H17V12Z" />
            </svg>
                        <p>Start Booking</p>
                    </div>
                    </div>
                    <p className="disclaimer">disclaimer</p>
                    </div>
                </div>
            </li>
    </div>
  );
};

export default Route;
